<p>The <span class="important">phosphate group</span>, unlike the <span class="important">nitrogenous bases</span>, <em>does</em> contain <span class="highlight">phosphorus</span>.  Its crucial role is to link the individual <span class="important">nucleotides</span> together, forming the long chains characteristic of DNA and RNA molecules.</p>
